와 딱 친구한테 추천받고 어떤지 리뷰 찾아보다 너무 예쁜 썸네일에 이끌려서 들어오게 되었는데 진짜 유익했어요! 초등학생때부터 손이 거칠거칠해서 핸드크림은 지금까지 필수템이 되었는데요,, 향에도 예민하고 끈적이는것도 너무 싫어해서 핸드크림 고를때도 엄청 깐깐한데 스카이보틀 핸드크림은 향도 증명되었고(친구피셜 인생향) 보습도 속보습 겉보송 완벽해서 꼭 받아보고 싶어요
향을 고르자면 화이트레인향이 원픽일 것 같아요 섬유유연제 향 누가싫어헤?외않사;;
곧 성인이 되어서 분위기 전환을 해보고 싶은데 전혀 차분하지 않은 제 이미지를 스카이보틀 핸드크림으로 차분하게 만들고 싶어요 향이 그 사람의 첫인상에 가장 중요하다고 생각하는 1ㅅ!
